import axios from 'axios'
import { 
    SEARCH_LIST_REQUEST,
    SEARCH_LIST_SUCCESS,
    SEARCH_LIST_FAIL,
    PRODUCT_DETAILS_REQUEST,
    PRODUCT_DETAILS_SUCCESS,
    PRODUCT_DETAILS_FAIL,
} from '../constants/searchConstants'

export const resultList = () => {
    {
        return async function(dispatch) {
        const response  = await axios.get('https://content.googleapis.com/customsearch/v1?cx=001361074102112665899%3Ap7mybnrloug&q=forritun&searchType=image&key=AIzaSyCefJfjoi6Qx4o9UL7ruz8gaQ_MH71e7Ck')

        dispatch({type: 'SEARCH_LIST_SUCCESS', payload: response })
      }
    } 
}
